This feature adds two fields in CSIDriver spec: type CSIDriverSpec struct { ... // existing fields RequiresRepublish *bool TokenRequests []TokenRequest
} type TokenRequest struct { Audience string ExpirationSeconds *int64
} TokenRequest.Audience : This is a required field. Audiences should be distinct, otherwise the validation will fail. If it is empty string, the audience of the token is the APIAudiences of kube-apiserver. one of the audiences specified. See more about audience specification here TokenRequest.ExpirationSeconds : The field is optional. It has to be at least 10 minutes (600 seconds) and no more than 1 << 32 seconds. RequiresRepublish : This field is optional. If this is true, NodePublishVolume will be periodically called. When used with TokenRequest, the token will be refreshed if it expired. NodePublishVolume should only change the contents rather than the mount because container will not be restarted to reflect the mount change. The period between NodePublishVolume is 0.1s. The token will be bounded to the pod that the CSI driver is mounting volumes for and will be set in VolumeContext: "csi.storage.k8s.io/serviceAccount.tokens": { <audience>: { 'token': <token>, 'expirationTimestamp': <expiration timestamp in RFC3339 format>, }, ...
} If CSI driver doesn't find token recorded in the volume_context, it should return error in NodePublishVolume to inform Kubelet to retry.

