In-tree storage e2e tests could be used to test CSI storage plugins. Your repo should be setup similar to how the NFS CSI plugin is setup, where the testfiles are in a test directory and the main test file is in the cmd directory. To be able to import Kubernetes in-tree storage tests, the CSI plugin would need to use Kubernetes v1.14+ (add to plugin's GoPkg.toml, since pluggable E2E tests become available in v1.14). CSI plugin authors would also be required to implement a testdriver for their CSI plugin. The testdriver provides required functionality that would help setup testcases for a particular plugin. For any testdriver these functions would be required (Since it implements the TestDriver Interface ): GetDriverInfo() *testsuites.DriverInfo SkipUnsupportedTest(pattern testpatterns.TestPattern) PrepareTest(f *framework.Framework) (*testsuites.PerTestConfig, func()) The PrepareTest method is where you would write code to setup your CSI plugin, and it would be called before each test case. It is recommended that you don't deploy your plugin in this method, and rather deploy it manually before running your tests. GetDriverInfo will return a DriverInfo object that has all of the plugin's capabilities and required information. This object helps tests find the deployed plugin, and also decides which tests should run (depending on the plugin's capabilities). Here are examples of the NFS and Hostpath DriverInfo objects: testsuites.DriverInfo{ Name: "csi-nfsplugin", MaxFileSize: testpatterns.FileSizeLarge, SupportedFsType: sets.NewString( "", // Default fsType ), Capabilities: map[testsuites.Capability]bool{ testsuites.CapPersistence: true, testsuites.CapExec: true, },
} testsuites.DriverInfo{ Name: "csi-hostpath", FeatureTag: "", MaxFileSize: testpatterns.FileSizeMedium, SupportedFsType: sets.NewString( "", // Default fsType ), Capabilities: map[testsuites.Capability]bool{ testsuites.CapPersistence: true, },
} You would define something similar for your CSI plugin. SkipUnsupportedTest simply skips any tests that you define there. Depending on your plugin's specs, you would implement other interfaces defined here . For example the NFS testdriver also implements PreprovisionedVolumeTestDriver and PreprovisionedPVTestDriver interfaces, to enable pre-provisioned tests. After implementing the testdriver for your CSI plugin, you would create a csi-volumes.go file, where the implemented testdriver is used to run in-tree storage testsuites, similar to how the NFS CSI plugin does so . This is where you would define which testsuites you would want to run for your plugin. All available in-tree testsuites can be found here . Finally, importing the test package into your main test file will initialize the testsuites to run the E2E tests . The NFS plugin creates a binary to run E2E tests, but you could use go test instead to run E2E tests using a command like this: go test -v <main test file> -ginkgo.v -ginkgo.progress --kubeconfig=<kubeconfig file> -timeout=0
